window.bookSummaryJSON = "<p>Monica does not abdicate. She will not resign herself to a man's will…even a man as strong as Jonathan. She's not weak or fragile, nor does she break at the first sign of trouble.</p> <p>Until she realizes she's falling in love with him, and that she’ll never be the same if she allows it.</p> <p>She breaks into a million sharp pieces and damages him in the process.</p> <p>But what can she do?</p> <p>Stay with him and untangle the mess of his life?</p> <p>Commit to his rules, his secrets, his troubles?</p> <p>No.</p> <p>She'll commit to a man, not a lie.</p> <p>She'll strip away everything between them, even if it ends them.</p> <p>An Audie Award Finalist under the title Control Burn Resist</p>"; 
